import * as Screens from './screens';
import { ThemeProvider } from 'styled-components';
import { lightTheme, darkTheme } from './styles/theme';
import { GlobalStyles } from './styles/global';

function App() {
  return (
    <ThemeProvider theme={lightTheme}>
      <>
        <GlobalStyles />
        <div className="App">
          <Screens.Diary.Main />
        </div>
      </>
    </ThemeProvider>
  );
}

export default App;
